import React from 'react';

class Footer extends React.Component {
    render(){
        return (
        <footer>
            <div>
                Pebibits Technologies Pvt. Ltd. All Right Reserved | Design by <a href="">Pebibits Technologies</a>
            </div>
        </footer>
        );
        }
    }
export default Footer;
